"use strict";
var sinon = require('sinon');
var assert = require('chai').assert;
var Logger = require('logger-ro');
var config = require("config");
global.__logConfig = config.get('logger');
var logger = new Logger(__logConfig);
var api = require('../interfaces/FacePlusPlus/api.js');
/**
 * @module face++ api单元测试用例
 */
describe(" unit tests for face++ api", function(){
    /**
     * @description  测试组件module
     */
    describe("#face++ api model", function(){
        /**
         * @static 测试face++ api方法
         */
        it(".postFaceDetect()", function(done) {
            this.timeout(10000);
            logger.trace('start test face++ api.postFaceDetect');
            var faceApiKey = config.get("faceApiKey");
            var faceApiSecret = config.get("faceApiSecret");
            var imageBase64 = "";
            var landmark = 0;
            var attributes = "gender,age,eyestatus,emotion,ethnicity,beauty";
            api.postFaceDetect(faceApiKey,faceApiSecret,imageBase64,landmark,attributes,function(err,result){
                if(err){
                    logger.error(err.stack);
                }else{
                    logger.debug(result.text);
                }
                done();
            });
        })
    });
});
